import React, { Component } from 'react'
import {
    Col, Container, Row
} from 'react-bootstrap'

export default class Cats extends Component {
    render() {
        return (
            <Container>
                <Row>
                    <Col>
                        <div>
                            <h1>Hello Cats</h1>
                        </div>
                    </Col>
                </Row>
            </Container>
        );
    }
}
